import React from "react";

const DiaryDateCalendar = ({ selectedDate, onDateChange }) => {
    return (
        <input 
            type="date" 
            value={selectedDate} 
            onChange={(e) => onDateChange(e.target.value)} 
        />
    );
};

export default DiaryDateCalendar;
